 CREATE TABLE venue_temp (
    uuid BIGINT(20) NOT NULL PRIMARY KEY,
    start_date DATE,
    end_date DATE,
    fee DOUBLE
);



UPDATE venue v
        JOIN
    venue_temp t ON v.uuid = t.uuid
SET
    v.start_date = t.start_date,
    v.end_date = t.end_date,
    v.fee = t.fee;

drop table venue_temp;